import React, { Component } from 'react'
import './index.css'

export default class Item extends Component {
    render() {
        const {name} = this.props

        return (
            <li>
                <label>
                    <input type='checkbox' onChange={this.handleCheck}/>
                    <span>{name}</span>
                </label>
                <button  className='btn btn-danger'>Delete</button>
            </li>
        )
    }
}
